import React, { Component } from "react";
import { Col } from "antd";

export class About extends Component {
  render() {
    return (
      <Col span={8}>
        <div
          style={{
            color: "white",
            fontWeight: "bold",
            fontSize: "25px",
            marginLeft: "25px"
          }}
        >
          Name
        </div>
        <div style={{ color: "white", marginLeft: "20px" }}>Choi Jong Sun(최종선)</div>
        <div style={{ color: "white", fontWeight: "bold", fontSize: "25px", marginLeft: "20px" }}>
          Age
        </div>
        <div style={{ color: "white", marginLeft: "20px" }}>28</div>
        <div style={{ color: "white", fontWeight: "bold", fontSize: "25px", marginLeft: "20px" }}>
          Date of Birth
        </div>
        <div style={{ color: "white", marginLeft: "20px" }}>1992.03.29</div>
        <div style={{ color: "white", fontWeight: "bold", fontSize: "25px", marginLeft: "20px" }}>
          Nationality
        </div>
        <div style={{ color: "white", marginLeft: "20px" }}>Korea</div>
      </Col>
    );
  }
}

export default About;
